import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'; 
import Navbar from './components/Navbar';

class App extends Component{
  render(){
    return(
      <div>
        <Navbar />
        <h2> Hello Kimberly</h2>
      </div>
    );
  }
}

